import React, {useState, useEffect} from 'react'
import axios from 'axios'

const url = ''

const getShop = () => {
const [shop, setShop] = useState(null)

        axios.get(url, {
            headers: {
                'Access-Control-Allow-Origin' : '*',
                'Access-Control-Allow-Methods':'GET,PUT,POST,DELETE,PATCH,OPTIONS'
                }
        }).then((res)=>{
            setShop(res.data)
        })

    return (<div>{shop}</div>)
}

export {getShop}
